    padding: '12px',
    margin: '0 6px 6px',
    background: 'lightgrey',
    textDecoration: 'none',
    color: 'white',
    borderRadius: '0 px',

  }


class Navbar extends React.Component {

    render() {
     return (
//         <div style="display:flex;justify-content:center;align-items:center;">
//   <div></div>
// </div>

        <span className={"flex-container"}>
        <h1        className={"logo"}
        >Sticky Note</h1>
        <NavLink
          to="/"
          exact
          style={link}
          activeStyle={{
            background: 'grey'
          }}
        >Notes</NavLink>

        <NavLink
          to="/reminders"
          exact
