          activeStyle={{
            background: 'grey'
          }}
        >Reminders</NavLink>

        <NavLink
          to="/archived"
          exact
          style={link}
          activeStyle={{
            background: 'grey'
          }}
        >Archive</NavLink>
      </span>

     )
    }
}  
   export default Navbar;
